import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Solutions", "Projects", "Gear", "Music", "Contact"];
export default function Header() {
  return (

    <nav class="navbar fixed-top navbar-expand-lg toggle-height" id="global-nav">
      <div class="container">
        <Link href="/">
          <a class="navbar-brand scrollN">Prabhakar Mishra</a>
        </Link>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
            {services_array.map(service => (
              <Link href={`/${service}`}>
                <li class="nav-item active">
                  <a class="nav-link scrollN">{service}</a>
                </li>
              </Link>
            ))}
          </ul>
        </div>
      </div>
    </nav>

  )
}
